
import React, { Component } from 'react';
class CustCarousel extends Component {
    state = {
        slide: 0
    }
    render() {
        return (
<div id="carouselImage" className="carousel slide" data-ride="carousel"  style={{"max-height": "500px"}}>
                    <ol className="carousel-indicators">
                    {this.state.slide == 1 ?
                    <>
                        <li data-target="#carouselExampleIndicators" data-slide-to="0" ></li>
                        <li data-target="#carouselExampleIndicators" data-slide-to="1" className="active"></li>
                        <li data-target="#carouselExampleIndicators" data-slide-to="2"></li>
                        </>
                        : this.state.slide == 2 ?
                        <>
                        <li data-target="#carouselExampleIndicators" data-slide-to="0" ></li>
                        <li data-target="#carouselExampleIndicators" data-slide-to="1"></li>
                        <li data-target="#carouselExampleIndicators" data-slide-to="2" className="active"></li>
                        </>
                        :
                        <>
                        <li data-target="#carouselExampleIndicators" data-slide-to="0" className="active"></li>
                        <li data-target="#carouselExampleIndicators" data-slide-to="1"></li>
                        <li data-target="#carouselExampleIndicators" data-slide-to="2"></li>
                        </>
                    }
                    </ol>
                    <div className="carousel-inner" style={{ "position": "relative", "max-height": "inherit", "width": "100%", "height": "100%" }}>
                    {this.state.slide == 1 ?
                        <div className="carousel-item active" style={{ "position": "relative", "max-height": "inherit"}}>
                            <img className="d-block w-100" style={{ "max-height": "inherit", "width": "100%"}} src={"data:image/jpeg;base64,"} alt="Second slide" />
                        </div>
                     
                        : this.state.slide == 2 ?
                        <div className="carousel-item active" style={{ "position": "relative", "max-height": "inherit"}}>
                            <img className="d-block w-100" style={{ "max-height": "inherit", "width": "100%"}} src={"data:image/jpeg;base64,"} alt="Third slide" />
                        </div>
                      
                        : 
                        <div className="carousel-item active" style={{ "position": "relative", "max-height": "inherit"}}>
                            <img className="d-block w-100" style={{ "max-height": "inherit", "width": "100%"
                            }} src={this.props.truck.image_url} alt="First slide" />
                        </div>
                        }
                    </div>
                    <a className="carousel-control-prev"  role="button" data-slide="prev" onClick={(event)=> {if(this.state.slide >= 0){this.setState({slide: this.state.slide - 1})}else{this.setState({slide: 2 })}}}>
                        <span className="carousel-control-prev-icon" aria-hidden="true"></span>
                        <span className="sr-only" ></span>
                    </a>
                    <a className="carousel-control-next"  role="button" data-slide="next" onClick={(event)=> {if(this.state.slide <= 2){this.setState({slide: this.state.slide + 1})}else{this.setState({slide: 0 })}}}>
                        <span className="carousel-control-next-icon" aria-hidden="true"></span>
                        <span className="sr-only" ></span>
                    </a>
                </div> 
           

       

        );
    }
}

export default CustCarousel;